import React from "react";

import "./shop.scss";
import ModelPreview from "../../components/models-preview/model-preview";
import SHOP_DATA from "./shop.data";

class ShopPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      collections: SHOP_DATA,
    };
  }
  render() {
    const {...otheCollectionsProps } = this.state;
    return (
      <div>
        <ModelPreview key={id} {...otheCollectionsProps} />
      </div>
    );
  }
}
export default ShopPage;
